style.css:
/* Anime-style CSS */

/* Change background color */
body {
    background-color: #f2f2f2;
}

/* Change font style */
body, p, h1, h2, h3, h4, h5, h6 {
    font-family: 'Arial', sans-serif;
}

/* Add a border to images */
img {
    border: 2px solid #000;
    border-radius: 5px;
}

/* Change text color */
p, h1, h2, h3, h4, h5, h6 {
    color: #333;
}

/* Add a shadow to text */
h1, h2, h3, h4, h5, h6 {
    text-shadow: 2px 2px 4px #666;
}

/* Add a border to links */
a {
    border-bottom: 1px solid #999;
}

/* Change link color */
a:link, a:visited {
    color: #0066cc;
}

/* Change link hover color */
a:hover {
    color: #ff3300;
}
